    private static double ffff(List<String> jsonArray, double sumLevel, double xishuA, double xishuB) {
        List<OneData> list = new ArrayList<>(jsonArray.size());
        List<Double> shouyi = new ArrayList<>();
        jsonArray.forEach(e -> {
            String arr[] = e.split(",");
            OneData oneData = new OneData();
            oneData.date = arr[0];
            oneData.start = Double.parseDouble(arr[1]);
            oneData.end = Double.parseDouble(arr[2]);
            oneData.startEndDiff = (oneData.end - oneData.start) / oneData.start * 100;
            if (list.size() != 0) {
                OneData lastOneData = list.get(list.size() - 1);
                oneData.last2StartDiff = (oneData.start - lastOneData.end) / lastOneData.end * 100;
                oneData.last2EndDiff = (oneData.end - lastOneData.end) / lastOneData.end * 100;
                if (list.size() > 1) {
                    double sum = lastOneData.last2EndDiff * xishuA + lastOneData.last2StartDiff * xishuB; //
                    String color = ANSI_RESET;
                    boolean needLog = false;
                    if (sum > sumLevel) { //
                        needLog = true;
                        color = oneData.last2StartDiff > 0 ? ANSI_GREEN : ANSI_RED;
                        shouyi.add(oneData.last2StartDiff);
                    }
                    if (needLog) {
                        System.out.println(color + String.format("\t日期：%s  \t上日开涨：%.2f  \t上日收涨：%.2f  \t上日波动：%.2f  \t开比上收：%.2f  \t当日开涨：%.2f  \t指数：%.2f ",
                                oneData.date,
                                lastOneData.last2StartDiff,
                                lastOneData.last2EndDiff,
                                lastOneData.startEndDiff,
                                Math.abs(oneData.last2StartDiff / lastOneData.last2EndDiff),
                                oneData.last2StartDiff,
                                sum
//                            oneData.last2EndDiff
                        ) + ANSI_RESET);
                    }
                }
            }
            list.add(oneData);
        });
        double shouyiSum = shouyi.stream().mapToDouble(e -> e).sum() - 0.001 * shouyi.size();
        System.out.printf("累积%d次，累计收益:%.2f,平均收益：%.2f\n", shouyi.size(), shouyiSum, shouyiSum / shouyi.size());
        return shouyiSum;
    }


